import React , { useState } from 'react'
import QrReader from 'react-qr-scanner'

function QrScan() {
    const [result, setResult] = useState('No result');

    const QrResult = () => {
      //const SplitData = setResult(data)
      //const SplitDataArr = SplitData.split(',')
      //console.log(setResult(data))

      const input = setResult
      const data = input.split(",")

    }

    const Test = () => {
      var sentence = "Oh a cookie!"
      sentence.split(" ");
      console.log(sentence)
    }
    


    return (
        <div>
            <QrReader
                delay={100}
                onError={err => console.log(err)}
                onScan={QrResult}
                style={{ width: '100%' }}
            />
            <p>{result}</p>
            {Test}
        </div>
    )
}


export default QrScan
